import "fmt"
func main()  {
    fmt.Println("这里是mian")
}
func  init()  {
    fmt.Println("这里是Init1")
}
func  init()  {
    fmt.Println("这里是Init2")
}
//输出结果
这里是Init1
这里是Init2
这里是main

