gin框架实现Restfui Api及中间件

下面的案例结合gin实现一个单体项目的Restfui风格的API架构设计，及编写基于gin框架的中间件。

项目的架构
Demo/
├── api
├── cache
├── conf
├── middleware
├── model
├── pkg
│  ├── e
│  ├── logging
│  ├── util
├── routes
├── serializer
└── service

api : 用于定义接口函数
cache : 放置redis缓存
conf : 用于存储配置文件
middleware : 应用中间件
model : 应用数据库模型
pkg/e : 封装错误码
pkg/logging : 日志打印
pkg/util : 工具函数
routes : 路由逻辑处理
serializer : 将数据序列化为 json 的函数
service : 接口函数的实现

api
func UserRegister(c *gin.Context) {
    if err := c.ShouldBind(&userRegisterService); err == nil {
        res := userRegisterService.Register()
        c.JSON(200, res)
    } else {
        c.JSON(400, ErrorResponse(err))
        util.Logger().Info(err)
    }
}

func UserLogin(c *gin.Context) {
    var userLoginService service.UserService
    if err := c.ShouldBind(&userLoginService); err == nil {
        res := userLoginService.Login()
        c.JSON(200, res)
    } else {
        c.JSON(400, ErrorResponse(err))
        util.Logger().Info(err)
    }
}

service
type UserService struct {
    UserName  string `form:"user_name" json:"user_name" binding:"required,min=3,max=15" example:"FanOne"`
    Password  string `form:"password" json:"password" binding:"required,min=5,max=16" example:"FanOne666"`
}

func (service *UserService) Register() *serializer.Response {
    code := e.SUCCESS
    var user model.User
    var count int
    model.DB.Model(&model.User{}).Where("user_name=?",service.UserName).First(&user).Count(&count)
    //表单验证
    if count == 1 {
        code = e.ErrorExistUser
        return &serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    user.UserName=service.UserName
    //加密密码
    if err := user.SetPassword(service.Password); err != nil {
        logging.Info(err)
        code = e.ErrorFailEncryption
        return &serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    //创建用户
    if err := model.DB.Create(&user).Error; err != nil {
        logging.Info(err)
        code = e.ErrorDatabase
        return &serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    return &serializer.Response{
        Status: code,
        Msg:    e.GetMsg(code),
    }
}

//Login 用户登陆函数
func (service *UserService)Login() serializer.Response {
    var user model.User
    code := e.SUCCESS
    if err := model.DB.Where("user_name=?", service.UserName).First(&user).Error; err != nil {
        //如果查询不到，返回相应的错误
        if gorm.IsRecordNotFoundError(err) {
            logging.Info(err)
            code = e.ErrorNotExistUser
            return serializer.Response{
                Status: code,
                Msg:    e.GetMsg(code),
            }
        }
        logging.Info(err)
        code = e.ErrorDatabase
        return serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    if user.CheckPassword(service.Password) == false {
        code = e.ErrorNotCompare
        return serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    token, err := util.GenerateToken(user.ID,service.UserName, 0)
    if err != nil {
        logging.Info(err)
        code = e.ErrorAuthToken
        return serializer.Response{
            Status: code,
            Msg:    e.GetMsg(code),
        }
    }
    return serializer.Response{
        Status: code,
        Data:   serializer.TokenData{User: serializer.BuildUser(user), Token: token},
        Msg:    e.GetMsg(code),
    }
}

