var m11 string = `G:\runtime\log\ccapi\11M.log`
// 测试用的文本文件400M大小
var m400 string = `G:\runtime\log\ccapi\400M.log`
// 将文件完整读取
func readAllBuff(filePath string) {
    start1 := time.Now()
    // 打开文件
    FileHandle, err := os.Open(filePath)
    if err != nil {
        log.Println(err)
        return
    }
    // 关闭文件
    defer FileHandle.Close()
    // 获取文件当前信息
    fileInfo, err := FileHandle.Stat()
    if err != nil {
        log.Println(err)
        return
    }
    buffer := make([]byte, fileInfo.Size())
    // 读取文件内容,并写入buffer中
    n, err := FileHandle.Read(buffer)
    if err != nil {
        log.Println(err)
    }
    // 打印所有切片中的内容
    fmt.Println(string(buffer[:n]))
    fmt.Println("readAllBuff spend : ", time.Now().Sub(start1))
}
func main() {
    readAllBuff(m11)
    readAllBuff(m400)
}
分片读取

对文件一部分一部分逐步的读取,直到文件完全读取完
PS : 每次读取文件的大小是根据设置的 分片 大小 ,所以对于读 取文本类型的文件时(例如 : 日志文件)
不一定是按照你的期望逐行输出,因为不会处理文本尾部的换行符,而是按照分片大小读取内容
使用场景 :
1、读取超大的文件很合适
2、读二进制类型的文件很合适(比如:音视频文件或者资源类型文件等)

package main

import (
    "bufio"
    "fmt"
    "io"
    "io/ioutil"
    "log"
