    "time"
)
// 测试用的文本文件11M大小
var m11 string = `G:\runtime\log\ccapi\11M.log`
// 测试用的文本文件400M大小
var m400 string = `G:\runtime\log\ccapi\400M.log`
// 文件一块一块的读取
func readBlock(filePath string) {
    start1 := time.Now()
    FileHandle, err := os.Open(filePath)
    if err != nil {
        log.Println(err)
        return
    }
    defer FileHandle.Close()
    // 设置每次读取字节数
    buffer := make([]byte, 1024)
    for {
        n, err := FileHandle.Read(buffer)
        // 控制条件,根据实际调整
        if err != nil && err != io.EOF {
            log.Println(err)
        }
        if n == 0 {
            break
        }
        // 如下代码打印出每次读取的文件块(字节数)
        //fmt.Println(string(buffer[:n]))
    }
    fmt.Println("readBolck spend : ", time.Now().Sub(start1))
}
func main() {
    readBlock(m11)
    readBlock(m400)
}
文件逐行读取

对文件一行一行的读取,直到读到文件末尾
使用场景 :
1、读取超大的文件很合适(例如 : 超大log文件等)
2、读取的文件最好是有换行的(如果使用单行文件组成的大文件,需要注意)
3、对需要分析内容的大文件
